import React, { Component } from 'react'
import './what.css'
import Header from '../../components/Header'
import Footer from '../../components/Footer'

class Whatwedo extends Component{
    render() {
        return(
            <div id="site-wrapper">
                <Header />
                    <div id="page-content">
                        <h1>This is what we do page</h1>
                    </div>
                <Footer />
            </div>
        );
    }
}

export default Whatwedo
